import React, {useEffect} from 'react';
import {BrowserRouter, Switch, Route} from 'react-router-dom';
import Register from './companies/Register';
import Login from './companies/Login';
import Landing from './landing/Landing';
import Header from './../components/header/Header';
import { useDispatch, connect } from 'react-redux';
import { authCheck } from './../';


function Routes({ currentCompany }) {
    const dispatch = useDispatch();

    useEffect(() => {
        dispatch(authCheck());
    },[dispatch])


    return(
        <BrowserRouter>
        <Header></Header>
            <Switch>
                <Route exact path="/" exact component={Landing}></Route>
                <Route exact path="/register" component={Register}></Route>
                <Route exact path="/login" component={Login}></Route>
            </Switch>
        </BrowserRouter>
    );
    
};

const mapStateToProps = ( {company: {currentCompany}} ) => ({
    currentCompany
});



export default connect(mapStateToProps, null)(Routes);
